import firebase_admin
from firebase_admin import credentials, firestore

# Initialize the Firebase admin using your credentials
cred = credentials.Certificate("/home/eramcheg/PycharmProjects/key4_Terminal.json")
firebase_admin.initialize_app(cred)

# Create the Firestore client
db = firestore.client()

# Reference the collection where your documents are stored
collection_ref = db.collection("Product")

# Prepare a query to filter documents by the 'group' field
query_ref = collection_ref

# Execute the query and retrieve the documents
query_results = query_ref.stream()

# Initialize a dictionary to store your results
products_dict = {}

# Iterate over the query results and save them into the dictionary
for doc in query_results:
    # doc.id is the document's ID and doc.to_dict() is the document's data
    products_dict[doc.id] = doc.to_dict()

# Now you have all the documents with 'group' == '8' in a dictionary
print(products_dict)
